import React from 'react'
import { numberTypeAnnotation } from 'babel-types';

//res.header('Access-Control-Allow-Origin', "*")
class AltUsers extends React.Component {
  constructor() {
    super();
    this.state = {
      names: [],
      fsuIds: [],
    };
  }



componentDidMount() {
  fetch('http://127.0.0.1:5000/randUsers')
  .then(results => {
    return results.json();
  }).then(res => {
    //let names = 
    var users = [];
    var ids = [];
    res.data.map((user) => {
      users.push(user.name)
    })

    res.data.map((id) => {
      ids.push(id.fsu_id)

    })
    this.setState({names: users})
    //this.setState({fsuIds: ids})
  })

}
render() {
  return(
    this.state.names.map((names) => {
      return(
      <div class="container">
      <div class="card firstUsers" id="searchUsers" key={names.toString()}>
            <h1 class="name">{names}</h1>
            <p class="email"></p>

        </div>
      </div>
      )
    })
  )

}
}
export default AltUsers
